DROP TABLE IF EXISTS #TempRecords
SELECT T.*, BP.acctID, BP.AccountNumber, BP.ccinhparent125AID, BP.SystemStatus, BP.JointAccountDate 
--,ROW_NUMBER() OVER(PARTITION BY T.ACCOUNT_ID ORDER BY SN) RecordCount
INTO #TempRecords 
FROM ##TempData T
JOIN BSegment_Primary BP WITH (NOLOCK) ON (T.ACCOUNT_ID = BP.UniversalUniqueID)

SELECT * FROM #TempRecords WHERE JointAccountDate IS NULL

SELECT * FROM #TempRecords WHERE JointAccountDate IS NULL
--13024


--ACCOUNT LEVEL CHECK STARTS
SELECT DISTINCT T.* 
FROM #TempRecords T
JOIN BSegment_MStatuses  B ON (T.acctID = B.acctID AND B.MStatusCode = 16034 AND B.IsDeleted = '0')
WHERE JointAccountDate IS NULL
--AND B.MStatusCode = 16034
--AND B.IsDeleted = '0'
--12876

SELECT DISTINCT T.*
INTO #MissingStatusAccounts 
FROM #TempRecords T
LEFT JOIN BSegment_MStatuses  B ON (T.acctID = B.acctID AND B.MStatusCode = 16034 AND B.IsDeleted = '0')
WHERE JointAccountDate IS NULL
--AND B.MStatusCode = 16034
--AND B.IsDeleted = '0'
AND B.acctID IS NULL
--148

SELECT RTRIM(AccountNumber) AccountNumber, 16034 ManualStatus FROM #MissingStatusAccounts

--ACCOUNT LEVEL CHECK ENDS

SELECT TOP 1 * FROM Customer WITH (NOLOCK)

DROP TABLE IF EXISTS #Customers
SELECT T.*, C.CustomerID, C.ClientID
INTO #Customers
FROM Customer C WITH (NOLOCK)
JOIN #TempRecords T WITH (NOLOCK) ON (C.BSAcctID = T.acctID)
--WHERE T.Person_ID = C.ClientID

SELECT RTRIM(AccountNumber) AccountNumber, CQ.ClientID, 16034 CustomerStatus, 0 AccountStatusFlag, 0 Action
FROM #Customers C
JOIN CustomerStatusQueue CQ WITH (NOLOCK) ON (C.acctID = CQ.acctID AND CQ.MStatusCode = 16034 AND CQ.IsDeleted = '0')


SELECT *
FROM #Customers C
LEFT JOIN CustomerStatusQueue CQ WITH (NOLOCK) ON (C.acctID = CQ.acctID AND CQ.MStatusCode = 16034 AND CQ.IsDeleted = '0')
WHERE CQ.acctID IS NULL


SELECT StatusDescription, Priority, * FROM AStatusAccounts WHERE StatusDescription LIKE '%DESIST%'

DROP TABLE IF EXISTS ##TempData
CREATE TABLE ##TempData (SN DECIMAL(19, 0) IDENTITY(1, 1), ACCOUNT_ID VARCHAR(64), PERSON_ID VARCHAR(64), ROLE VARCHAR(20), REFINED_ROLE VARCHAR(20))

